const Games = () => {
  const navigate = useNavigate();

  const goTo = (gameId: string) => {
    navigate(gameId);
  };

  return (
    <>
      <div className="grid-container">
        {gameData.map((game) => {
          return (
            <div
              key={game.id}
              onClick={() => goTo(game.id)}
              className="game__item"
            >
              <h1 className="game__item--header">{game.title}</h1>
              <img
                className="game__item--img"
                src={game.imgUrl}
                alt={game.imgUrl}
              />
            </div>
          );
        })}
      </div>
    </>
  );
};
export default Games;
